            console.log(args.name);
            return `Bienvenido ${args.name}`;
        },

        teams (){
            return teams;
        }

    },

    Mutation: {
        createTeams(_, {input}){
            input._id = teams.length;
            teams.push(input);
            return input;
        }
    }
};

